	add("libertarian", "{\"term\":\"libertarian\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"1789 {{suffix|liberty|arian|lang\u003den}}{{rel-top|sense changes}}\u0027libertaire\u0027 (anarchist) formed from \u0027liberté\u0027 (freedom) from Latin \u0027libertas\u0027 and the suffix \u0027-aire\u0027 from Latin \u0027-arius\u0027 First appeared in English in 1789 by w:William Belsham|William Belsham, in his \u0027[http://books.google.com/books?hl\u003den\u0026amp;id\u003dfg4WAAAAYAAJ Essays].\u0027 This was contrasted with necessitarian, in the context of w:free will|free will, and was not used in the current sense.The French word is first attested in a letter in May 1857 by French w:Anarchist communism|anarcho-communist w:Joseph Déjacque|Joseph Déjacque to anarchist philosopher w:Pierre-Joseph Proudhon|Pierre-Joseph Proudhon, reading:\u0026lt;ref\u0026gt;[http://joseph.dejacque.free.fr/ecrits/lettreapjp.htm De l\u0027être-humain mâle et femelle: Lettre à P.J. Proudhon]\u0026lt;/ref\u0026gt;:“Anarchiste juste-milieu, libéral et non LIBERTAIRE…”In translation::“A centrist anarchist, liberal and not LIBERTARIAN…”hence the sense is of “extreme left-wing”.The French term was popularized as a euphemism for anarchist in the 1890s, following the w:lois scélérates|lois scélérates, when anarchist publications were banned by law in France.The sense of “pro-property individualist” developed in the US in the 1940s, and was popularized in the 1950s. In the 1940s, w:Leonard Read|Leonard Read began calling himself “libertarian” to contrast with “classical liberal”.\u0026lt;ref\u0026gt;{{cite web|url\u003dhttp://www.libertarianism.org/ex-3.html|title\u003dA Note on Labels: Why \u0026quot;Libertarian\u0026quot;?}}\u0026lt;/ref\u0026gt; In 1955, w:Dean Russell|Dean Russell also promoted use of the word, writing: “Let those of us who love liberty trademark and reserve for our own use the good and honorable word ‘libertarian’.”\u0026lt;ref\u0026gt;Dean Russell, [http://www.boogieonline.com/revolution/politics/name.html \u0027Who is a Libertarian?\u0027], Foundation for Economic Education, \u0026quot;Ideas on Liberty,\u0026quot; May, 1955.\u0026lt;/ref\u0026gt;{{rel-bottom}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who advocates liberty either generally or on a specific issue, \u0027e.g.\u0027 \u0026quot;civil libertarian\u0026quot; (in favor of civil liberties\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A believer in a political doctrine that emphasizes individual liberty and a lack of governmental regulation and oversight both in matters of the economy (\u0027free market\u0027) and in personal behavior where no one\u0027s rights are being violated or threatened. Also \u0027classical liberal\u0027, akin to \u0027anarcho-capitalist\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A member of a political party that emphasizes self-government in economic and personal issues\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A left-libertarian, an antiauthoritarian believer in both individual freedom and social justice (social equality and ), such as a social anarchist\u0026lt;!--see WP--\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027 Eugene Lunn, \u0027Prophet of Community: The Romantic Socialism of Gustav Landauer\u0027 (Univ. of California Press) page 200\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Landauer\u0027s reorientation of anarchist theory and practice in the direction of idealist and völkisch thought was often incomprehensible to the more traditional \u0027\u0027libertarians\u0027\u0027, and in the period of the second \u0027Sozialist\u0027 Landauer no longer felt entirely comfortable with the simple \u0026quot;anarchist\u0026quot; label. For Landauer anarchism and socialism had always been different expressions of the same view; now he regarded anarchism as \u0026quot;merely the negative side of what is positively called socialism.\u0026quot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027 Peter Marshall, \u0027Demanding the Impossible: A History of Anarchism\u0027, page 641\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"For a long time, \u0027\u0027libertarian\u0027\u0027 was interchangeable in France with anarchist but in recent years, its meaning has become more ambivalent. Some anarchists like David Guérin will call themselves \u0027libertarian socialists\u0027, partly to avoid the negative overtones still associated with anarchism, and partly to stress the place of anarchism with the socialist tradition. Even Marxists of the New Left like E. P. Thompson call themselves \u0027\u0027libertarian\u0027\u0027 to distinguish themselves from those authoritarian socialists and communists who believe in revolutionary dictatorship and vanguard parties\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027 Wilbur R. Miller, \u0027The Social History of Crime and Punishment in America: An Encyclopedia\u0027 (SAGE Publications) page 1008\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"While anarchism and socialist \u0027\u0027libertarians\u0027\u0027 have a rich history of revolutionary thinkers ranging from Emma Goldman to George Orwell, the best-known socialist \u0027\u0027libertarian\u0027\u0027 thinker of today is probably Noam Chomsky\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A believer in thinking beings\u0027 freedom to choose their own destiny, \u0027i.e.\u0027 a believer in free will as opposed to those who believe the future is predetermined\", \"priority\":11}]}, \"synonyms\":{}}");

	add("libertarianism", "{\"term\":\"libertarianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|libertarian|ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A political philosophy maintaining that all persons are the absolute owners of their own lives, and should be free to do whatever they wish with their persons or property, provided they allow others that same liberty\", \"priority\":1}]}, \"synonyms\":{}}");

	add("libertinism", "{\"term\":\"libertinism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|libertine|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lifestyle or pattern of behavior characterized by self-indulgence and lack of restraint, especially one involving sexual promiscuity and rejection of religious or other moral authority\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1852\u0027\u0027, William Makepeace Thackeray, \u0027The History of Henry Esmond, Esq.\u0027, ch. 13\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The lord made a boast of his \u0027\u0027libertinism\u0027\u0027, and frequently avowed that he held all women to be fair game\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1855\u0027\u0027, Washington Irving, \u0026quot;The Grand Prior of Minorca: A Veritable Ghost Story,\u0026quot; in \u0027Chronicles of Wolfert\u0027s Roost and Other Papers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"They led a life of luxury and \u0027\u0027libertinism\u0027\u0027, and were to be found in the most voluptuous courts of Europe\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, David Gross and Sophfronia Scott, \u0026quot;[http://www.time.com/time/magazine/article/0,9171,970634-4,00.html Proceeding With Caution],\u0026quot; \u0027Time\u0027, 16 Jul\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Only on college campuses do remnants of \u0027\u0027libertinism\u0027\u0027 linger. That worries public-health officials, who are witnessing an explosion of sexually transmitted diseases\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Peter N. Miller, \u0026quot;‘Freethinking’ and ‘Freedom of Thought’ in Eighteenth-Century Britain,\u0026quot; \u0027The Historical Journal\u0027, vol. 36, no. 3, p. 601\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"To facilitate their counter-attack, the targets of this critique sought to reduce the plurality of \u0027\u0027libertinisms\u0027\u0027 to a simple libertine personality\", \"priority\":9}]}, \"synonyms\":{}}");

	add("liberty", "{\"term\":\"liberty\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027liberte\u0027 from Old french (842-ca. 1400) \u0027liberté\u0027 from Latin \u0027libertas\u0027 (freedom) from \u0027liber\u0027 (free) see \u0027liberal\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being free from control or restrictions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/books-and-arts/21606252-ideal-political-role-model-freedom-fighter Freedom passage\u003d[Edmund] Burke continued to fight for \u0027\u0027liberty\u0027\u0027 later on in life. He backed Americans in their campaign for freedom from British taxation. He supported Catholic freedoms and freer trade with Ireland, in spite of his constituents’ ire. He wanted more liberal laws on the punishment of debtors\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The condition of being free from imprisonment, slavery or forced labour\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The condition of being free to act, believe or express oneself as one chooses\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Freedom from excessive government control\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.guardian.co.uk/commentisfree/2012/dec/14/north-korea-boys-toys-threat-reaction We mustn\u0027t overreact to North Korea boys\u0027 passage\u003dThe threat of terrorism to the British lies in the overreaction to it of British governments. Each one in turn clicks up the ratchet of surveillance, intrusion and security. Each one diminishes \u0027\u0027liberty\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A short period when a sailor is allowed ashore\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A breach of social convention (often \u0027liberties\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A local government unit in medieval England – see w:Liberty liberty\", \"priority\":9}]}, \"synonyms\":{}}");

	add("libido", "{\"term\":\"libido\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{PIE root|en|lewbʰ}}From Latin {{m|la|libīdō||lust, desire}}. Used originally in psychoanalytic contexts.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Sexual urges or drives\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Good grief man, control your \u0027\u0027libido\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Drives or mental energies related to or based on sexual instincts but not necessarily sexual in and of themselves\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"For Freudians, \u0027\u0027libido\u0027\u0027 means the desire to \u0026quot;unite and bind\u0026quot; with objects in the world\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The ego as an organ which seeks to synthesize thoughts in the psyche is said to be driven by \u0027\u0027libido\u0027\u0027 or eros\", \"priority\":5}]}, \"synonyms\":{}}");

