	add("library", "{\"term\":\"library\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"Middle english (1100-1500) \u0027librarie\u0027 () from Anglo-norman \u0027librarie\u0027 from Old french (842-ca. 1400) \u0027librairie\u0027 from Latin \u0027librarium\u0027 (lang\u003dla) from \u0027librarius\u0027 (lang\u003dla) from \u0027liber\u0027 (lang\u003dla) probably derived from a Proto-Indo-European base {{m|ine-pro|*leub(h)||to strip, to peel}}. Displaced native Middle english (1100-1500) \u0027bochus\u0027 (from Old english (ca. 450-1100) {{m|ang|bōchūs||library, bookhouse}}). Romance cognates often mean “bookshop” instead French {{m|fr|librairie}}, Italian {{m|it|libreria}}, and Portuguese {{m|pt|livraria}}. This is a recent innovation (16th century in French), displacing earlier sense.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An institution which holds books and/or other forms of stored information for use by the public or qualified people. It is usual, but not a defining feature of a library, for it to be housed in rooms of a building, to lend items of its collection to members either with or without payment, and to provide various other services for its community of users\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A collection of books or other forms of stored information\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An equivalent collection of analogous information in a non-printed form, e.g. record librar\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A collection of software subprograms that provides functionality, to be incorporated into or used by a computer program\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A collection of DNA material from a single organism or relative to a single diseas\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The deck or draw pile\", \"priority\":6}]}, \"synonyms\":{}}");

